import React, { useEffect, useState } from "react";
import { getTasks } from "../api"; // Assuming you have a function to fetch tasks
import { FaEdit, FaTrashAlt } from "react-icons/fa"; // Importing the edit and delete icons
import TaskModal from "./TaskModal";
import "./TaskList.css";

const TaskList = () => {
  const [tasks, setTasks] = useState([]);
  const [isModalOpen, setModalOpen] = useState(false);

  // Fetch tasks from the backend
  const fetchTasks = async () => {
    try {
      const taskList = await getTasks(); // Replace with actual API call
      setTasks(taskList);
    } catch (error) {
      console.error("Error fetching tasks:", error);
    }
  };

  useEffect(() => {
    fetchTasks(); // Load tasks on page load
  }, []);

  // Show the Add Task modal
  const handleAddTask = () => {
    setModalOpen(true);
  };

  // Handle task addition
  const handleTaskAdded = (newTask) => {
    setTasks((prevTasks) => [...prevTasks, newTask]); // Add new task to the list
  };

  // Handle Edit task
  const handleEditTask = (taskId) => {
    // Implement edit functionality, e.g., opening a modal to edit the task
    console.log(`Edit task with ID: ${taskId}`);
  };

  // Handle Delete task
  const handleDeleteTask = (taskId) => {
    // Implement delete functionality, e.g., calling API to delete the task
    console.log(`Delete task with ID: ${taskId}`);
  };

  return (
    <div className="task-list-container">
      <h1>Real-Time Task Management Dashboard</h1>
      <button onClick={handleAddTask} className="add-task-btn">Add Task</button>

      <table className="task-table">
        <thead>
          <tr>
            <th>Task ID</th>
            <th>Task Name</th>
            <th>Status</th>
            <th>Created At</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task) => (
            <tr key={task.id}>
              <td>{task.id}</td>
              <td>{task.name}</td>
              <td>{task.status}</td>
              <td>{task.createdAt}</td>
              <td>
                {/* Edit and Delete Icons */}
                <FaEdit 
                  className="icon edit-icon" 
                  onClick={() => handleEditTask(task.id)} 
                />
                <FaTrashAlt 
                  className="icon delete-icon" 
                  onClick={() => handleDeleteTask(task.id)} 
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Add Task Modal */}
      <TaskModal
        isOpen={isModalOpen}
        onClose={() => setModalOpen(false)}
        onTaskAdded={handleTaskAdded}
      />
    </div>
  );
};

export default TaskList;
